.text

# s4, s5 stores the address of Player 1 and Player 2 table
# s6, s7 store the number of 1 of Player 1 and Player 2
main:
    jal 	clear_mem
    
    la		$a0, 0
    jal		drawImg
    ###THIS FIELD TO OPEN A FILE
    li		$v0, 13
    la		$a0, fileName
    li		$a1, 1
    syscall
    mtc1	$v0, $f0#f0 store the file's description
    ###
    
    li 		$v0, 55
    la 		$a0, Welcome_text
    li		$a1, 1
    syscall
    li 		$v0, 55
    la 		$a0, Ins_text
    li		$a1, 1
    syscall
    
    li		$a0, 6
    jal		logToFile
    
    la 		$s4, Player1
    la 		$a3, Player1
    jal 	input
    jal 	store_reg
    jal 	clear_mem
    jal 	restore_reg
    addi 	$s6, $0, 16
    la 		$s5, Player2
    la 		$a3, Player2
    jal 	input
    addi 	$s7, $0, 16

    li		$a0, 7
    jal		logToFile
    jal 	GameProcess
    j 		exitProgram

GameProcess:
Player1_attack:
    addi 	$sp, $sp, -4
    sw 		$ra, 0($sp)
    jal 	store_reg
    jal 	clear_mem
    jal 	restore_reg
    display_selection_1:
    li		$v0, 51
    la		$a0, Display
    syscall
    beqz	$a1, process_display_selection_1
    beq		$a1, -2, cancel_display_selection_1
    j		display_selection_1
    cancel_display_selection_1:
    li		$v0, 50
    la		$a0, confirm_cancel_display
    syscall
    beqz	$a0, exitProgram
    j		display_selection_1
    process_display_selection_1:
    add		$t0, $a0, $0
    bltz	$t0, display_selection_1
    bgt		$t0, 1, display_selection_1
    jal		store_reg
    beqz	$t0, History_table_1
    la 		$a0, Player1
    j 		dis_1
    History_table_1:
    la		$a0, Player1_Dis
    dis_1:
    jal 	display_table
    jal		restore_reg
    bnez	$t0, display_selection_1
    lw 		$ra, 0($sp)
    addi 	$sp, $sp, 4
    Player1_enter_x:
    li 		$v0, 51
    la 		$a0, Player1_Attack_x_text
    syscall
    beqz	$a1, Player1_save_x
    beq		$a1, -1, Player1_enter_x
    beq		$a1, -3, Player1_enter_x
    la		$a0, confirm_cancel
    li		$v0, 50
    syscall
    beqz	$a0, exitProgram
    j		Player1_enter_x
    Player1_save_x:
    add 	$t8, $a0, $0
    Player1_enter_y:
    li		$v0, 51
    la 		$a0, Player1_Attack_y_text
    syscall
    beqz	$a1, Player1_save_y
    beq		$a1, -1, Player1_enter_y
    beq		$a1, -3, Player1_enter_y
    la		$a0, confirm_cancel
    li		$v0, 50
    syscall
    beqz	$a0, exitProgram
    beq		$a0, 1, Player1_enter_x
    j		Player1_enter_y
    Player1_save_y:
    add 	$t9, $a0, $0
    addi 	$sp, $sp, -4
    sw 		$ra, 0($sp)
    add 	$a0, $t8, $0
    add 	$a1, $t9, $0
    add 	$a2, $s5, $0
    jal 	gameSta
    lw 		$ra, 0($sp)
    addi 	$sp, $sp, 4
    beq 	$v0, 4, Player2_attack#v0 = 0: error length, v0 = 1: diagnosis, v0 = 2: ship position is overlapsed, v0 = 3: out of range, v0 = 4: correct ship
    addi	$sp, $sp, -4
    sw		$ra, 0($sp)
    jal		printError
    lw		$ra, 0($sp)
    addi	$sp, $sp, 4
    addi 	$sp, $sp, -4
    sw 		$ra, 0($sp)
    jal 	store_reg
    jal 	clear_mem
    jal 	restore_reg
    li		$t0, 0
    jal		store_reg
    j 		History_table_1
Player2_attack:
    addi 	$sp, $sp, -4
    sw 		$ra, 0($sp)
    jal 	store_reg
    jal 	clear_mem
    jal 	restore_reg
    display_selection_2:
    li		$v0, 51
    la		$a0, Display
    syscall
    beqz	$a1, process_display_selection_2
    beq		$a1, -2, cancel_display_selection_2
    j		display_selection_2
    cancel_display_selection_2:
    li		$v0, 50
    la		$a0, confirm_cancel_display
    syscall
    beqz	$a0, exitProgram
    j		display_selection_2
    process_display_selection_2:
    add		$t0, $a0, $0
    bltz	$t0, display_selection_2
    bgt		$t0, 1, display_selection_2
    jal		store_reg
    beqz	$t0, History_table_2
    la 		$a0, Player2
    j 		dis_2
    History_table_2:
    la		$a0, Player2_Dis
    dis_2:
    jal 	display_table
    jal		restore_reg
    bnez	$t0, display_selection_2
    lw 		$ra, 0($sp)
    addi 	$sp, $sp, 4
    Player2_enter_x:
    li		$v0, 51
    la 		$a0, Player2_Attack_x_text
    syscall
    beqz	$a1, Player2_save_x
    beq		$a1, -1, Player2_enter_x
    beq		$a1, -3, Player2_enter_x
    la		$a0, confirm_cancel
    li		$v0, 50
    syscall
    beqz	$a0, exitProgram
    j		Player2_enter_x
    Player2_save_x:
    add 	$t8, $a0, $0
    Player2_enter_y:
    li		$v0, 51
    la 		$a0, Player2_Attack_y_text
    syscall
    beqz	$a1, Player2_save_y
    beq		$a1, -1, Player2_enter_y
    beq		$a1, -3, Player2_enter_y
    la		$a0, confirm_cancel
    li		$v0, 50
    syscall
    beqz	$a0, exitProgram
    beq		$a0, 1, Player2_enter_x
    j		Player2_enter_y
    Player2_save_y:
    add 	$t9, $a0, $0
    addi 	$sp, $sp, -4
    sw 		$ra, 0($sp)
    add 	$a0, $t8, $0
    add 	$a1, $t9, $0
    add 	$a2, $s4, $0
    jal 	gameSta
    lw 		$ra, 0($sp)
    addi 	$sp, $sp, 4
    beq		$v0, 4, Player1_attack
    addi	$sp, $sp, -4
    sw		$ra, 0($sp)
    jal		printError
    lw		$ra, 0($sp)
    addi	$sp, $sp, 4
    addi 	$sp, $sp, -4
    sw 		$ra, 0($sp)
    jal 	store_reg
    jal 	clear_mem
    jal 	restore_reg
    li		$t0, 0
    jal		store_reg
    j 		History_table_2

###-------------INPUT FUNCTION----------------###
input:
#reg t0: use for i (index)
#input coordinate for 2x1 ship
    add 	$t8, $0, $0 # t8 uses for display ship input 
    li 		$v0, 55
    la 		$t9, Player2
    beq 	$t9, $a3, P2_turn
    la 		$a0, Player1_text
    li		$a1, 1
    j 		printOutTurn
P2_turn:
    la 		$a0, Player2_text
printOutTurn:
    syscall

input_2x1:
    bge 	$t8, 3, set_up_for_input_3x1
    li 		$v0, 55
    la 		$a0, input_2x1_text
    li		$a1, 1
    syscall
    la 		$a0, ship_text
    addi 	$a1, $t8, 49
    sb		$a1, 0($a0)
    li		$a1, 1
    li 		$v0, 55
    syscall
    addi 	$a2, $0, 1
    addi 	$sp, $sp, -4
    sw 		$ra, 0($sp)
    jal 	input_check
    lw 		$ra, 0($sp)
    addi 	$sp, $sp, 4
    bne 	$v0, 4, input_2x1
    addi 	$t8, $t8, 1
    j 		input_2x1

set_up_for_input_3x1:
    add 	$t8, $0, $0

input_3x1:
    bge 	$t8, 2, set_up_for_input_4x1
    li 		$v0, 55
    la 		$a0, input_3x1_text
    li		$a1, 1
    syscall
    la 		$a0, ship_text
    addi 	$a1, $t8, 49
    sb		$a1, 0($a0)
    li		$a1, 1
    li 		$v0, 55
    syscall
    addi 	$a2, $0, 2
    addi 	$sp, $sp, -4
    sw 		$ra, 0($sp)
    jal 	input_check
    lw 		$ra, 0($sp)
    addi 	$sp, $sp, 4
    bne 	$v0, 4, input_3x1
    addi 	$t8, $t8, 1
    j 		input_3x1

set_up_for_input_4x1:
    add 	$t8, $0, $0

input_4x1:
    bge 	$t8, 1, done_input
    li 		$v0, 55
    la 		$a0, input_4x1_text
    li		$a1, 1
    syscall
    la 		$a0, ship_text
    addi 	$a1, $t8, 49
    sb		$a1, 0($a0)
    li		$a1, 1
    li 		$v0, 55
    syscall
    addi	$a2, $0, 3
    addi 	$sp, $sp, -4
    sw 		$ra, 0($sp)
    jal 	input_check
    lw 		$ra, 0($sp)
    addi 	$sp, $sp, 4
    bne 	$v0, 4, input_4x1
    addi 	$t8, $t8, 1
    j 		input_4x1

done_input:
    jr 		$ra
###-------------END OF INPUT FUNCTION---------------###

###--------------INPUT CHECK OUT--------------------###
#return flase if input is invalid
bow_input:
#-------------x-bow input---------------#
input_check:
    li 		$v0, 51
    la 		$a0, x_bow_text
    syscall
    bne		$a1, -2, check_x_bow_input
    li		$t9, 1
    j		cancel_bow
    check_x_bow_input:
    beq		$a1, -1, error_input
    beq		$a1, -3, error_input
    add 	$s0, $0, $a0
#---------------------------------------#

y_bow_input:
#------------y-bow input----------------#
    li 		$v0, 51
    la 		$a0, y_bow_text
    syscall
    bne		$a1, -2, check_y_bow_input
    li		$t9, 2
    j		cancel_bow
    check_y_bow_input:
    beq		$a1, -1, error_input
    beq		$a1, -3, error_input
    add 	$s1, $0, $a0
#----------------------------------------#

    add 	$a0, $s0, $0
    add 	$a1, $s1, $0
    addi 	$sp, $sp, -4
    sw 		$ra, 0($sp)
    jal 	checkAvaiCoordinate
    lw 		$ra, 0($sp)
    addi 	$sp, $sp, 4
    bne 	$v0, 4, error_input
    j		stern_input
#------------cancel-bow---------------#

cancel_bow:
    la		$a0, cancel_checkout
    li		$v0, 50
    syscall
    beqz	$a0, exitProgram
    beq		$a0, 1, bow_input
    beq		$t9, 1, bow_input
    j		y_bow_input

stern_input:
#------------x-stern input---------------#
    li 		$v0, 51
    la 		$a0, x_stern_text
    syscall
    bne		$a1, -2, check_x_stern_input
    li		$t9, 1
    j		cancel_stern
    check_x_stern_input:
    beq		$a1, -1, error_input
    beq		$a1, -3, error_input
    add 	$s2, $0, $a0
#----------------------------------------#

y_stern:
#------------y-stern input---------------#
    li 		$v0, 51
    la 		$a0, y_stern_text
    syscall
    bne		$a1, -2, check_y_stern_input
    li		$t9, 2
    j		cancel_stern
    check_y_stern_input:
    beq		$a1, -1, error_input
    beq		$a1, -3, error_input
    add 	$s3, $0, $a0
    j		done_input_stern
#----------------------------------------#


#------------cancel stern----------------#

cancel_stern:
    li		$v0, 50
    la		$a0, cancel_checkout
    syscall
    beqz	$a0, exitProgram
    beq		$a0, 1, stern_input
    beq		$t9, 1, stern_input
    j		y_stern

#----------------------------------------#

done_input_stern:
    add 	$a0, $s2, $0
    add 	$a1, $s3, $0
    addi 	$sp, $sp, -4
    sw 		$ra, 0($sp)
    jal 	checkAvaiCoordinate
    lw 		$ra, 0($sp)
    addi 	$sp, $sp, 4
    beq 	$v0, 4, checkOverLapse
    
    j		error_input
    checkOverLapse:
    addi 	$sp, $sp, -4
    sw 		$ra, 0($sp)
    add 	$a0, $a3, $0
    jal 	isOverLapse
    lw 		$ra, 0($sp)
    addi 	$sp, $sp, 4
    bne 	$v0, 4, error_input
    sub 	$t0, $s0, $s2
    beq 	$t0, $a2, valid
    sub 	$t0, $s2, $s0
    beq 	$t0, $a2, valid
    sub 	$t0, $s1, $s3
    beq 	$t0, $a2, valid
    sub 	$t0, $s3, $s1
    beq 	$t0, $a2, valid
    li		$v0, 0
    j 		error_input

valid:
    add 	$a0, $a3, $0
    addi 	$sp, $sp, -4
    sw 		$ra, 0($sp)
    jal 	set_up_table
    jal 	store_reg
    jal 	display_table
    jal 	restore_reg
    jal		store_reg
    beq		$a3, $s5, player2SetUp
    player1SetUp:
    li		$a0, 0
    j		logSetUp
    player2SetUp:
    li		$a0, 1
    logSetUp:
    addi	$sp, $sp, -4
    sb		$s0, 0($sp)
    sb		$s1, 1($sp)
    sb		$s2, 2($sp)
    sb		$s3, 3($sp)
    jal		logToFile
    addi	$sp, $sp, 4
    jal		restore_reg
    lw 		$ra, 0($sp)
    addi 	$sp, $sp, 4
    li		$v0, 4
    jr 		$ra

error_input:
    addi	$sp, $sp, -4
    sw		$ra, 0($sp)
    jal		printError
    lw		$ra, 0($sp)
    addi	$sp, $sp, 4
    jr 		$ra
###------------------------------------------------------###

###------------SET-UP TABLE---------------###
#a0: Player table, x_bow, y_bow, x_stern and y_stern are stores in sp 
set_up_table:
    ###This field is used to store data for input
    move 	$t1, $s0 # x_bow
    move 	$t2, $s1 # y_bow
    move 	$t3, $s2 # x_stern
    move 	$t4, $s3 # y_stern
    beq 	$t2, $t4, set_if_y_equal
    blt 	$t2, $t4, set_if_y_bow_smaller
    add 	$t5, $t4, $0
    add 	$t6, $t2, $0
    j 		set_in_board_if_x_eq
set_if_y_bow_smaller:
    add 	$t5, $t2, $0
    add 	$t6, $t4, $0
set_in_board_if_x_eq:
    bgt 	$t5, $t6, done_set_up
    mul 	$t7, $t1, 7
    addu 	$t7, $t7, $t5
    addu 	$t7, $t7, $a0
    li 		$t0, 1
    sb 		$t0, 0($t7)
    addi 	$t5, $t5, 1
    j 		set_in_board_if_x_eq

set_if_y_equal:
    blt 	$t1, $t3, set_if_x_bow_smaller
    add 	$t5, $t3, $0
    add 	$t6, $t1, $0
    j 		set_in_board_if_y_eq
set_if_x_bow_smaller:
    add 	$t5, $t1, $0
    add 	$t6, $t3, $0
set_in_board_if_y_eq:
    bgt 	$t5, $t6, done_set_up
    mul 	$t7, $t5, 7
    addu 	$t7, $t7, $t2
    addu 	$t7, $t7, $a0
    addi 	$t0, $0, 1
    sb 		$t0, 0($t7)
    addi 	$t5, $t5, 1
    j 		set_in_board_if_y_eq
done_set_up:
    jr 		$ra
###---------------------------------------###

###-------------CHECK COORDINATES FUNCTION----------------###
checkAvaiCoordinate:#a0: x coordinate, a1: y coordinate
    blt 	$a0, $0, invalid
    blt 	$a1, $0, invalid
    bgt 	$a0, 6, invalid
    bgt 	$a1, 6, invalid
    li	 	$v0, 4
    j 		end_of_checkAvaiCoordinate
invalid:
    li	 	$v0, 3
end_of_checkAvaiCoordinate:
    jr 		$ra
###-------------END OF CHECK COORDINATES FUNCTION---------------###

###-------------CHECK OVERLAPSE FUNCTION----------------###
isOverLapse:#a0: address of Player matrix x_bow, y_bow, x_stern, y_stern is now placing in stack inorder
    move 	$t1, $s0#t1 = x_bow
    move 	$t2, $s1#t2 = y_bow
    move 	$t3, $s2#t3 = x_stern
    move 	$t4, $s3#t4 = y_stern
###-------------check diagnal------------------###
    beq 	$t1, $t3, x_equal # x_bow == x_stern ?
    beq 	$t2, $t4, y_equal # y_bow != y_stern ?
    li	 	$v0, 1
    jr		$ra 
###-------------end of check diagnal-----------###
x_equal:
    add 	$t0, $0, $0
    blt 	$t2, $t4, x_bow_stern
    add 	$t5, $t4, $0
    add 	$t6, $t2, $0
    j 		x_st_ed
x_bow_stern:
    add 	$t5, $t2, $0
    add 	$t6, $t4, $0
x_st_ed:
x_for_checked:
    bgt 	$t5, $t6, done_checked 
    mul 	$t7, $t1, 7
    addu 	$t7, $t7, $t5
    addu 	$t7, $t7, $a0
    lbu 	$t7, 0($t7)
    beqz 	$t7, x_next_for_checked
    li	 	$v0, 2
    jr 		$ra
x_next_for_checked:
    addi 	$t5, $t5, 1
    j 		x_for_checked

y_equal:
    add 	$t0, $0, $0
    blt 	$t1, $t3, y_bow_stern
    add 	$t5, $t3, $0
    add 	$t6, $t1, $0
    j		y_st_ed
y_bow_stern:
    add 	$t5, $t1, $0
    add 	$t6, $t3, $0
y_st_ed:
y_for_checked:
    bgt 	$t5, $t6, done_checked 
    mul 	$t7, $t5, 7
    addu 	$t7, $t7, $t2
    addu 	$t7, $t7, $a0
    lbu 	$t7, 0($t7)
    beqz 	$t7, y_next_for_checked
    li		$v0, 2
    jr 		$ra
y_next_for_checked:
    addi 	$t5, $t5, 1
    j 		y_for_checked
done_checked:
    li	 	$v0, 4
    jr 		$ra

gameSta:
# a0: represent row x
# a1: represent column y
# a2: holds the address of Player table
# if: the cell at row a1 and column a2 contain 1, change it to 0 and print "HIT!"
# This function return 0 if all the cell is 0, otherwise return 1
# If the ship has been sunk, then the value in the approriate coordinate will be changed to 2
    addi 	$sp, $sp, -4
    sw 		$ra, 0($sp)
    jal 	checkAvaiCoordinate
    lw 		$ra, 0($sp)
    addi 	$sp, $sp, 4
    beq		$v0, 4, check
    li		$t1, 0
    j		error_coordinate
    check:
    mul 	$t8, $a0, 7
    add 	$t0, $t8, $a1
    add 	$t0, $t0, $a2
    lbu 	$t1, 0($t0)
    beq		$t1, 2, error_coordinate
    beq		$t1, 1, logging
    addi	$sp, $sp, -4
    sw		$ra, 0($sp)
    jal		store_reg
    la		$s0, Player1
    beq		$a2, $s0, player2_table
    player1_table:
    la		$a2, Player1_Dis
    j		Checkout
    player2_table:
    la		$a2, Player2_Dis
    Checkout:
    mul 	$t8, $a0, 7
    add 	$t0, $t8, $a1
    add 	$t0, $t0, $a2
    lbu 	$t1, 0($t0) 
    bne		$t1, 3, Miss
    jal		restore_reg
    lw		$ra, 0($sp)
    addi	$sp, $sp, 4
    li		$t1, 3
    j		error_coordinate
    Miss:
    jal		restore_reg
    lw		$ra, 0($sp)
    addi	$sp, $sp, 4
    logging:
    ###THIS FIELD IS TO LOG THE ATTACK COORDINATE
    addi	$sp, $sp, -4
    sw		$ra, 0($sp)
    jal		store_reg
    addi	$sp, $sp, -4
    sb		$a0, 0($sp)
    sb		$a1, 1($sp)
    beq		$a2, $s4, logToFilePlayer2Attack
    logToFilePlayer1Attack:
    li		$a0, 2
    j		log
    logToFilePlayer2Attack:
    li		$a0, 3
    log:
    jal		logToFile
    addi	$sp, $sp, 4
    jal		restore_reg
    lw		$ra, 0($sp)
    addi	$sp, $sp, 4
    ###
    mul 	$t8, $a0, 7
    add 	$t0, $t8, $a1
    add 	$t0, $t0, $a2
    lbu 	$t1, 0($t0)
    li 		$t2, 1
    bne 	$t1, $t2, MISS
HIT:
    beq 	$a2, $s4, decreasePlayer1
    addi 	$s7, $s7, -1
    j 		save_To_Player_Board
decreasePlayer1:
    addi 	$s6, $s6, -1
save_To_Player_Board:
    li	 	$t1, 2
    sb 		$t1, 0($t0)
    li 		$v0, 55
    la 		$a0, HIT_text
    move	$t0, $a1
    li		$a1, 1
    syscall
    la		$s0, Player1
    beq		$a2, $s0, saveToPlayer2_Dis_Hit
    saveToPlayer1_Dis_Hit:
    la		$s0, Player1_Dis
    add 	$s1, $t8, $t0
    add 	$s1, $s1, $s0
    li		$s0, 2
    sb		$s0, 0($s1)
    j 		updatedPlayerDis_Hit
    saveToPlayer2_Dis_Hit:
    la		$s0, Player2_Dis
    add 	$s1, $t8, $t0
    add 	$s1, $s1, $s0
    li		$s0, 2
    sb		$s0, 0($s1)
    updatedPlayerDis_Hit:
    addi	$sp, $sp, -4
    sw		$ra, 0($sp)
    jal		store_reg
    li		$a0, 4
    jal		logToFile
    jal		restore_reg
    lw		$ra, 0($sp)
    addi	$sp, $sp, 4
    j 		checkTable

MISS:
    la		$s0, Player1
    beq		$a2, $s0, saveToPlayer2_Dis
    saveToPlayer1_Dis:
    la		$s0, Player1_Dis
    mul 	$s1, $a0, 7
    add 	$s1, $s1, $a1
    add 	$s1, $s1, $s0
    li		$s0, 3
    sb		$s0, 0($s1)
    j 		updatedPlayerDis
    saveToPlayer2_Dis:
    la		$s0, Player2_Dis
    mul 	$s1, $a0, 7
    add 	$s1, $s1, $a1
    add 	$s1, $s1, $s0
    li		$s0, 3
    sb		$s0, 0($s1)
    updatedPlayerDis:
    li 		$v0, 55
    la 		$a0, MISS_text
    li		$a1, 0
    syscall
    addi	$sp, $sp, -4
    sw		$ra, 0($sp)
    jal		store_reg
    li		$a0, 5
    jal		logToFile
    jal		restore_reg
    lw		$ra, 0($sp)
    addi	$sp, $sp, 4
    li	 	$v0, 4
    jr 		$ra

error_coordinate:
    beq		$t1, 2, sunk_err
    beq		$t1, 3, ocean_err
    li		$v0, 3
    j		err_return
sunk_err:
    li		$v0, 5
    j		err_return
ocean_err:
    li		$v0, 6
   
err_return:
    jr 		$ra

checkTable:
    beqz 	$s7, Player1_win
    beqz 	$s6, Player2_win
    li	 	$v0, 4
    jr 		$ra
Player1_win:
    li 		$v0, 55
    la 		$a0, Player1_win_text
    li		$a1, 1
    syscall
    li		$a0, 8
    jal		logToFile
    la		$a0, Player1_Dis
    jal 	display_table
    addi 	$sp, $sp, 4
    j 		exitProgram
Player2_win:
    li 		$v0, 55
    la 		$a0, Player2_win_text
    li		$a1, 1
    syscall
    li		$a0, 9
    jal		logToFile
    la		$a0, Player2_Dis
    jal 	display_table
    addi 	$sp, $sp, 4
    j 		exitProgram

invalid_coordinate:
    addi	$sp, $sp, -4
    sw		$ra, 0($sp)
    jal		printError
    lw		$ra, 0($sp)
    addi	$sp, $sp, 4
    jr 		$ra

###------------DISPLAY TABLE------------###
display_table:
#a0: address of table
    addi	$sp, $sp, -4
    sw		$ra, 0($sp)
    jal		clear_mem
    lw		$ra, 0($sp)
    addi	$sp, $sp, 4
#----------DRAW TABLE----------#
    li 		$t0, 0               
    li 		$t6, 0	    
    la 		$t3, table 	
    li 		$t5, 0xFFFFFFFF
