end_draw_background:

###NEED TO BE FIXED
    li 		$t0, 0
    la 		$t3, table
    li 		$t5, 0x2596be

draw_table:
    bge 	$t0, 896, exit        
    li 		$t1, 0               
    sll 	$t7, $t6, 7
    bne 	$t0, $t7, draw_col
    #j		next_row
    mul		$t2, $t7, 256
    add		$t2, $t2, $t3
