    bge 	$t1, 7, next_row     
    mul 	$t2, $t0, 256  
    sll 	$t7, $t1, 7 
    add 	$t2, $t2, $t7       
    add 	$t4, $t3, $t2       
    sw 		$t5, 0($t4)          
    addi 	$t1, $t1, 1        
    j draw_col

next_row:
    addi 	$t0, $t0, 4        
    j draw_table
    
exit:

