end_display_table:
    jr 		$ra
###------------END OF DISPLAY TABLE------------###

###------------STORING REGISTER VALUE------------###
store_reg:
    addi	$sp, $sp, -88
    sw		$s0, 0($sp)
    sw		$s1, 4($sp)
    sw		$s2, 8($sp)
    sw		$s3, 12($sp)
    sw		$s4, 16($sp)
    sw		$s5, 20($sp)
    sw		$s6, 24($sp)
    sw		$s7, 28($sp)
    sw		$t0, 32($sp)
    sw		$t1, 36($sp)
    sw		$t2, 40($sp)
    sw		$t3, 44($sp)
    sw		$t4, 48($sp)
    sw		$t5, 52($sp)
    sw		$t6, 56($sp)
    sw		$t7, 60($sp)
    sw		$t8, 64($sp)
    sw		$t9, 68($sp)
    sw		$a0, 72($sp)
    sw		$a1, 76($sp)
    sw		$a2, 80($sp)
    sw		$a3, 84($sp) 
    jr 		$ra
###------------END OF STORING REGISTER VALUE------------###

###------------RESTORE REGISTER VALUE------------###
restore_reg:
    lw		$s0, 0($sp)
    lw		$s1, 4($sp)
    lw		$s2, 8($sp)
    lw		$s3, 12($sp)
    lw		$s4, 16($sp)
    lw		$s5, 20($sp)
    lw		$s6, 24($sp)
    lw		$s7, 28($sp)
    lw		$t0, 32($sp)
    lw		$t1, 36($sp)
    lw		$t2, 40($sp)
    lw		$t3, 44($sp)
    lw		$t4, 48($sp)
    lw		$t5, 52($sp)
    lw		$t6, 56($sp)
    lw		$t7, 60($sp)
    lw		$t8, 64($sp)
    lw		$t9, 68($sp)
    lw		$a0, 72($sp)
    lw		$a1, 76($sp)
    lw		$a2, 80($sp)
    lw		$a3, 84($sp)    
    addi	$sp, $sp, 88
    jr 		$ra
###------------END OF RESTORE REGISTER VALUE------------###

clear_mem:
    la 		$s0, table
    li 		$t0, 0
    li 		$t1, 0
clear:
    bge 	$t0, 65536, end_clear_mem
    sw 		$t1, 0($s0)
    addi 	$s0, $s0, 4
    addi 	$t0, $t0, 1
    j 		clear
end_clear_mem:
    jr 		$ra
    
printError:
    beq		$v0, 4, print_done
    beq		$v0, 1, diagnosis
    beq		$v0, 2, overlapsed
    beq		$v0, 3, out_of_range
    beq		$v0, 5, sunk_position
    beq		$v0, 6, ocean_position
invalid_length:
    la		$a0, error_length_text
    j		print
diagnosis:
    la		$a0, diagnosis_text
    j		print
overlapsed:
    la		$a0, overlapsed_text
    j		print
out_of_range:
    la		$a0, out_of_range_text
    j		print
sunk_position:
    la		$a0, Sunk_pos
    j		print
ocean_position:
    la		$a0, Ocean_pos
print:
    li		$v0, 55
    li		$a1, 0
    syscall
print_done:
    jr		$ra
    
logToFile:#a0: 
#0: write when player1 set up, 
#1: write when player 2 set up, 
#2: write when player 1 attack, 
#3: write when player 2 attack, 
#4: HIT, 
#5 MISS, 
#6, INPUT_LOG
#7, ATTACK_LOG
#8, Player1 Win
#9, Player2 Win
#x_bow(x), y_bow(y), x_stern, y_stern are store in sp respectively(store in byte order) 
    
    lbu		$t0, 0($sp)#x_bow(x)
    addi	$t0, $t0, 48
    lbu		$t1, 1($sp)#y_bow(y)
    addi	$t1, $t1, 48
    lbu		$t2, 2($sp)#x_stern
    addi	$t2, $t2, 48
    lbu		$t3, 3($sp)#y_stern
    addi	$t3, $t3, 48
    li		$v0, 15
    
    beq		$a0, 1, player2_set_up
    beq		$a0, 2, player1_attack
    beq		$a0, 3, player2_attack
    beq		$a0, 4, saveHit
    beq		$a0, 5, saveMiss
    beq		$a0, 6, Setup
    beq		$a0, 7, Attack
    beq		$a0, 8, P1_Win
    beq		$a0, 9, P2_Win
    
    player1_set_up:
    la		$a1, player1Put
    j		save_setup
    player2_set_up:
    la		$a1, player2Put
    save_setup:
    sb		$t0, 32($a1)
    sb		$t1, 34($a1)
    sb		$t2, 47($a1)
    sb		$t3, 49($a1)
    li		$a2, 52
    j		save
    
    player1_attack:
    la		$a1, Player1ChooseAttack
    j		save_attack_status
    player2_attack:
    la		$a1, Player2ChooseAttack
    save_attack_status:
    sb		$t0, 22($a1)
    sb		$t1, 24($a1)
    li		$a2, 28
    j		save
    
    saveHit:
    la		$a1, HIT_text
    li		$a2, 4
    j		save
    saveMiss:
    la		$a1, MISS_text
    li		$a2, 5
    j		save
    Setup:
    la		$a1, Setup_message
    li		$a2, 8
    j		save
    Attack:
    la		$a1, Attack_message
    li		$a2, 26
    j		save
    P1_Win:
    la		$a1, P1_Win_text
    li		$a2, 13
    j		save
    P2_Win:
    la		$a1, P2_Win_text
    li		$a2, 13
    
    save:
    mfc1	$a0, $f0
    syscall
    
    jr		$ra
    
drawImg:
    #a0 = 0: thumbnail,  a0 = 1 game end
    beq		$a0, 1, game_end_img
    la		$t0, thumbnail
    j		draw_img
    game_end_img:
    la		$t0, end_game
    draw_img:
    la		$a0, table
    li		$t1, 0
    loop_thumbnail:
    bge		$t1, 262144, end_draw_img
    lw		$t2, 0($t0)
    sw		$t2, 0($a0)
    addi	$a0, $a0, 4
    addi	$t0, $t0, 4
    addi	$t1, $t1, 4
    j		loop_thumbnail
    end_draw_img:
    jr		$ra
exitProgram:
    mfc1	$a0, $f0
    li		$v0, 16
    syscall
    jal		store_reg
    la		$a0, 1
    jal		drawImg
    jal		restore_reg
